INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (321, 1, 2, 0, 125801, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 1, 24001, 40011);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (322, 1, 2, 0, 126001, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 1, 24001, 40011);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (323, 1, 2, 0, 126101, "プレシア", "んーと。\nこれ、あげる。\nはい", 3, 1, 24001, 40011);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (324, 2, 2, 0, 125801, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 4, 1, 24001, 40011);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (325, 2, 2, 0, 126001, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 5, 1, 24001, 40011);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (326, 2, 2, 0, 126101, "プレシア", "お兄。\nきてくれて、うれしい", 6, 1, 24001, 40011);
